// src/pages/InternshipDetail.js
import React from "react";
import { useParams } from "react-router-dom";

const InternshipDetail = () => {
  const { id } = useParams();

  return (
    <div id="detailPage" className="page active">
      <div className="container">
        <nav className="breadcrumb">
          <a href="/">Home</a>
          <span>/</span>
          <a href="/internships">Search</a>
          <span>/</span>
          <span id="breadcrumbTitle">Internship Details</span>
        </nav>

        <div className="internship-detail" id="internshipDetail">
          {/* Internship details will be dynamically rendered here */}
          <p>Details for internship ID: {id}</p>
        </div>
      </div>
    </div>
  );
};

export default InternshipDetail;
